import React from "react";
import "./placecard.css";

export default function PlaceCard({ place, onOpen }) {
  return (
    <div className="place-card" onClick={() => onOpen(place)}>
      <img src={place.image} alt={place.name} />
      <h4>{place.name}</h4>
    </div>
  );
}
